import { Component } from "react";
import {TextField,Box, Button} from "@material-ui/core"
export default class CardMargens extends Component{


    render(){

        return(
            <Box sx={{border:"1px solid #c4c4c4",backgroundColor:"rgb(180, 223, 128)", width:"300px", height:"600px", padding:"0px 20px", boxSizing:"border-box"}}>
                <Box sx={{height:"500px", display:"flex", flexDirection:"column", justifyContent:"space-around"}}>
                    <TextField sx={{color:"white"}} color="warning" label="Digite a Receita Bruta"></TextField>
                    <TextField label="Digite a Receita Líquida"></TextField>
                    <TextField label="Digite o Lucro Bruto"></TextField>
                    <TextField label="Digite a Lucro Operacional"></TextField>
                    <TextField label="Digite a Lucro Líquido"></TextField>
                    <Button sx={{height:"56px"}} variant="outlined">Enviar</Button>
                </Box>
            </Box>

        )
    }
}
